import React, {useState} from 'react';
import { saveservice } from '../../../api/admin';
import { token } from '../../../api/auth';

const CreateServices = () => {
    const [Name, SetName] = useState()
    const [Annotation, SetAnnotation] = useState()
    const [IdSuperType, SetIdSuperType] = useState()
    const [IdType, setIdType] = useState()
    const [Cost, setCost] = useState()

    const Token = localStorage.getItem("token")


    const SaveSuper = (e) => {
        e.preventDefault()
        saveservice(Token, "super", Name, Annotation, Cost, IdType, IdSuperType)
    }
    const SaveType = (e) => {
        e.preventDefault()
        saveservice(Token, "type", Name, Annotation, Cost, IdType, IdSuperType)  
    }
    const SaveService = (e) => {
        e.preventDefault()
        console.log(saveservice(Token, "service", Name, Annotation, Cost, IdType, IdSuperType))
        // console.log(token(Token))
    }

  return (
    <form>
        <div> Супер тип
            Название: <input value={Name} onChange={e => SetName(e.target.value)}/>
            Аннотация: <input value={Annotation}  onChange={e => SetAnnotation(e.target.value)}/>
            <button onClick={SaveSuper}>Отправить</button> 
        </div>
        <div> Тип
            Название: <input value={Name} onChange={e => SetName(e.target.value)}/>
            Аннотация: <input value={Annotation}  onChange={e => SetAnnotation(e.target.value)}/>
            id супер типа: <input value={IdSuperType}  onChange={e => SetIdSuperType(e.target.value)}/>
            <button onClick={SaveType}>Отправить</button> 
        </div>
        <div> Услуга
            Название: <input value={Name} onChange={e => SetName(e.target.value)}/>
            Аннотация: <input value={Annotation}  onChange={e => SetAnnotation(e.target.value)}/>
            id типа: <input value={IdType}  onChange={e => setIdType(e.target.value)}/>
            цена: <input value={Cost}  onChange={e => setCost(e.target.value)}/>
            <button onClick={SaveService}>Отправить</button> 
        </div>
    </form>
  );
};
export default CreateServices;
